

CREATE TABLE dwh.dim_customer (
    sk_customer bigint NOT NULL,
    version integer,
    date_from datetime,
    date_to datetime,
    customer_id integer,
    customer_name text,
    customer_email varchar(50),
    customer_phone varchar(20),
    customer_address varchar(50),
    customer_district varchar(20),
    customer_city varchar(50),
    customer_country varchar(50),
    postal_code varchar(10),
    create_date datetime,
    active integer
);



CREATE TABLE dwh.dim_film (
    sk_film bigint NOT NULL,
    version integer,
    date_from datetime,
    date_to datetime,
    film_id integer,
    title varchar(255),
    description text,
    release_year integer,
    rental_rate numeric(6,2),
    length smallint,
    rating text,
    special_features text,
    film_language varchar(20),
    film_category varchar(25),
    actorname text
);





CREATE TABLE dwh.dim_staff (
    sk_staff bigint NOT NULL,
    version integer,
    date_from datetime,
    date_to datetime,
    staff_id integer,
    staff_name text,
    staff_email varchar(50),
    staff_address varchar(50),
    staff_district varchar(20),
    staff_city varchar(50),
    staff_country varchar(50),
    staff_postalcode varchar(10),
    staff_phone varchar(20),
    active boolean
);



CREATE TABLE dwh.dim_store (
    sk_store bigint NOT NULL,
    version integer,
    date_from datetime,
    date_to datetime,
    store_id integer,
    manager_staff_name text,
    store_address varchar(50),
    store_district varchar(20),
    store_city varchar(50),
    store_country varchar(50),
    store_postalcode varchar(10)
);



CREATE TABLE dwh.fact_sales (
    sk_paymentdate double precision,
    sk_rentaldate double precision,
    sk_returndate double precision,
    sk_film bigint,
    sk_customer bigint,
    sk_staff bigint,
    sk_store bigint,
    amount numeric(7,2),
    payment_date datetime,
    rental_date datetime,
    return_date datetime,
    sales_id double precision
);






